			<p>مين ما كنت وشو ما عملت إنت مهم بنظره بحار كنت أو طيار إنت مهم بنظره غني بشتى دولار أو فقير ولا دينار جوع من نجار صغار انت مهم بنظره مين ما كنت وشو ما عملت إنت مهم بنظره</p>
